Bull Shark - World's Deadliest Shark

Nature Documentary hosted by Nigel Marven, published by Discovery Channel in 2004 - English narration


Information
------------------------------

The bull shark: nine feet of brawn and muscle, one of the most aggressive animals on Earth.
We join zoologist Nigel Marven on a journey across the globe to learn more about these incredible predators.
Our first destination is the Bahamas, where Nigel meets shark scientist Erich Ritter in waist-deep bull shark infested waters. Erich has stood amongst the sharks hundreds of times before, but tragically he is attacked and bitten on the leg as Nigel stands next to him. Nigel decides to spend the next few months investigating bull sharks to try and learn why Erich's accident happened. In a series of hands-on investigations, Nigel explains how and why, bulls are the world's deadliest shark; there are a number of factors...


